import React from 'react';
import { useLocation, useNavigate } from 'react-router-dom';

function ResultsPage() {
  const location = useLocation();
  const navigate = useNavigate();  // 获取 navigate 函数
  const result = location.state ? location.state.result : "没有提供查询结果";

  const handleSelectionClick = () => {
    navigate('/selection');  // 导航到选择/修改界面
  };

  return (
    <div className="container mt-5">
      <h1>宿舍信息</h1>
      <div className="alert alert-info">{result}</div>
      <button className="btn btn-primary mt-3" onClick={handleSelectionClick}>选择/修改</button>  
    </div>
  );
}

export default ResultsPage;
